struct Pool {
  address poolAddress;
  address token0;
  address token1;
  uint256 token0Reserve;
  uint256 token1Reserve;
  uint256 swapFee;
}

struct KChecker {
  uint256 reserve0;
  uint256 reserve1;
  bool isToken0IsIntermediaryToken;
  uint256 oldAmount;
  uint256 newAmount;
  uint256 swapFee;
  address token0Address;
  address token1Address;
  address poolAddress;
}

struct CallbackData {
  uint256 debtAmount;
  address debtToken;
  Pool[] poolPath;
}

contract FlashswapMultiPool is Ownable {
  using SafeERC20 for IERC20;

  receive() external payable {}

  fallback() external {
